import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit and save to reload.
        </p>
        <a
          className="App-link"
          href="https://www.goportsmouthnh.com/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Explore Portsmouth
        </a>
      </header>


    </div>
  );
}

export default App;
